import React from 'react';
import { useParams } from 'react-router-dom';

import SongList from '../components/SongList'

const DUMMY_SONGS = [
    {
        id: 's1',
        title: 'Jebać PiS',
        description: 'One of the most important songs of 2020 and 2021',
        image: 'https://i.ytimg.com/vi/FQq6Mwv_jpw/maxresdefault.jpg',
        length: '3500',
        creator: 'u1'

    },
    {
        id: 's2',
        title: 'Jebać SąD',
        description: 'One of the most important songs of 2020 and 2021',
        image: 'https://pbs.twimg.com/media/EbXlmjgWsAEy0Ph.png',
        length: '3500',
        creator: 'u2'

    },
]

const UserSongs = () => {
    const userId = useParams().userId;
    const loadedPlaces = DUMMY_SONGS.filter(song => song.creator === userId);
    return (
        <SongList items={loadedPlaces} />
    );
};


export default UserSongs;
